import React  from 'react'
import {Comment} from './Comment'

const keys = (props) => Object.keys(props.comment)

export const Comments = ( props) => {
    return(
            <div>
                {keys.map( key => <Comment key={key}c={props.comment[key]}/>)} 
           </div>
    )
}
